import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image } from 'react-native';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';


const Home = () => {
    return (
        <Card style={style.mycard}>
            <View style={style.cardview}>
                <Image
                    style={{ width: 60, height: 60, borderRadius: 60 / 2 }}
                    source={{ uri: "https://images.unsplash.com/photo-1489939078242-0a1dc4a08f06?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTZ8fGxhZHl8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60" }}

                />
                <View style={{ marginLeft: 10 }}>
                    <Text style={style.text}>Hello Reshmika</Text>
                    <Text >Web Developer</Text>
                </View>
            </View>

            <View style={style.cardview}>
                <Image
                    style={{ width: 60, height: 60, borderRadius: 60 / 2 }}
                    source={{ uri: "https://images.unsplash.com/photo-1489939078242-0a1dc4a08f06?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTZ8fGxhZHl8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60" }}

                />
                <View style={{ marginLeft: 10 }}>
                    <Text style={style.text}>Hello Reshmika</Text>
                    <Text >Web Developer</Text>
                </View>
            </View>
            <View style={style.cardview}>
                <Image
                    style={{ width: 60, height: 60, borderRadius: 60 / 2 }}
                    source={{ uri: "https://images.unsplash.com/photo-1489939078242-0a1dc4a08f06?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTZ8fGxhZHl8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60" }}

                />
                <View style={{ marginLeft: 10 }}>
                    <Text style={style.text}>Hello Reshmika</Text>
                    <Text >Web Developer</Text>
                </View>
            </View>

        </Card>

    )
}

const style = StyleSheet.create({
    mycard: {
        margin: 15,
        backgroundColor: '#fff',
       


    },
    cardview: {
        flexDirection: 'row',
        margin: 15,
    },
    text: {
        fontSize: 20,

    }
})

export default Home;
